import React, { useState } from 'react';

const SecurityScore = ({ onNavigate }) => {
  const [email, setEmail] = useState('');
  const [analysis, setAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);

  const analyzeSecurity = async () => {
    if (!email) return;
    
    setLoading(true);
    try {
      const response = await fetch('http://localhost:5000/api/validate-email', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ email }),
      });
      
      const data = await response.json();
      setAnalysis(data);
    } catch (error) {
      console.error('Error:', error);
    }
    setLoading(false);
  };

  const getScoreClass = (score) => {
    if (score >= 80) return 'score-high';
    if (score >= 60) return 'score-medium';
    return 'score-low';
  };

  return (
    <div className="security-score">
      <div className="card">
        <h1><i className="fas fa-chart-bar"></i> Security Scoring</h1>
        <p>Comprehensive security analysis and social media integration</p>
        
        <div className="form-group">
          <label className="form-label">Email Address for Analysis</label>
          <input
            type="email"
            className="form-input"
            placeholder="user@example.com"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
        </div>
        
        <button 
          className="btn btn-primary"
          onClick={analyzeSecurity}
          disabled={loading}
        >
          {loading ? <div className="loading"></div> : <i className="fas fa-chart-line"></i>}
          {loading ? ' Analyzing...' : ' Analyze Security'}
        </button>

        {analysis && (
          <div className="security-analysis">
            <div className="score-section">
              <div 
                className={`score-circle ${getScoreClass(analysis.score)}`}
                style={{'--score-percent': `${analysis.score}%`}}
              >
                {analysis.score}%
              </div>
              <h3>Security Score</h3>
            </div>

            <div className="analysis-details">
              <h4>Security Analysis</h4>
              <div className="detail-item">
                <strong>Email Status:</strong> {analysis.valid ? 'Valid' : 'Invalid'}
              </div>
              <div className="detail-item">
                <strong>Phishing Detection:</strong> {analysis.is_phishing ? 'Detected' : 'Clean'}
              </div>
              <div className="detail-item">
                <strong>Domain:</strong> {analysis.domain || 'Unknown'}
              </div>
              
              <h4 style={{marginTop: '1.5rem'}}>Recommendations</h4>
              <ul>
                {analysis.recommendations?.map((rec, index) => (
                  <li key={index}>{rec}</li>
                ))}
              </ul>
            </div>

            <div className="social-integration">
              <h4>Social Media Integration</h4>
              <p>Linked accounts and online presence:</p>
              <div className="social-links">
                <a href="#" className="social-link">
                  <i className="fab fa-linkedin"></i> LinkedIn
                </a>
                <a href="#" className="social-link">
                  <i className="fab fa-twitter"></i> Twitter
                </a>
                <a href="#" className="social-link">
                  <i className="fab fa-github"></i> GitHub
                </a>
                <a href="#" className="social-link">
                  <i className="fab fa-facebook"></i> Facebook
                </a>
              </div>
            </div>
          </div>
        )}
      </div>
      
      <button 
        className="btn btn-secondary"
        onClick={() => onNavigate('home')}
        style={{marginTop: '2rem'}}
      >
        <i className="fas fa-arrow-left"></i> Back to Home
      </button>
    </div>
  );
};

export default SecurityScore;
